// create the row schema
case class MCCNodeRow(frameNum:String, cloudElemt:Int, centerLat:Double, centerLon:Double,ceArea:Double, maxTemp:Double, minTemp:Double)

// extract needed infro from the list
val MCCNodeMapList = MCCNodeMap.map{case(key,value) =>{
    val props = value.metadata.get("properties").getOrElse().asInstanceOf[mutable.HashMap[String, Double]]
    (value.frameNum.toString, value.cloudElemNum.toInt, props.get("centerLat").get, props.get("centerLon").get, props.get("area").get, props.get("maxTemp").get, props.get("minTemp").get)
}}

// create the table
val MCCnMap = sqlContext.sparkContext.parallelize(MCCNodeMapList.toSeq).map(v => MCCNodeRow(v._1,v._2,v._3,v._4,v._5,v._6,v._7)).toDF()

// register it
MCCnMap.registerTempTable("cloud_elems_table1")
